  if (first == BINARY_MAGIC.charAt(0))   dataHash=readBinary(inputStream);
 else   if (first == TEXTUAL_MAGIC.charAt(0))   dataHash=readTextual(inputStream);
 else   throw new IOException("Unsupported format.");
}

